 Create a database schema for storing and retrieving customer order information.

The database schema should consist of the following tables:

Table "Customers": Fields: "Customer ID", "Customer Name", "Customer Address";

Table "Orders": Fields: "Order ID", "Customer ID", "Product ID", "Product Name", "Product Price", "Customer Address";

Table "Products": Fields: "Product ID", "Product Name", "Product Price";

A relationship should exist between the Customers table and the Orders table, with the Customers ID field linking to the Orders Customers ID field.

A relationship should also exist between the Orders table and the Products table, with the Orders Product ID field linking to the Products

generated_response:
The schema should be implemented using SQL syntax.

## Solution

```sql
CREATE TABLE orders (
  order_id INTEGER PRIMARY KEY,
  customer_id INTEGER PRIMARY KEY,
  product_id INTEGER PRIMARY KEY,
  price FLOAT,
  quantity INTEGER,
  created_at DATETIME
);

CREATE TABLE products (
  product_id INTEGER PRIMARY KEY,
  name VARCHAR(255),
  price FLOAT
);

CREATE TABLE customers (
  customer_id INTEGER PRIMARY KEY,
  name VARCHAR(255)
);

CREATE TABLE orders_products (
  order_id INTEGER PRIMARY KEY,
  product_id INTEGER PRIMARY KEY
);
```

